  const changeUi = num => {
    setuiNum(num)
    console.log(uiNum)
  }
  if (uiNum == 0){
  return (
    <div>
        <PreGame changeUi = {changeUi} />
        <p>{uiNum}</p>
    </div>

    );
  }
  else{
    return (
      <div>
        <joinedGame changeUi = {changeUi} />
      </div>
    )
  }
}

export default App;
